public Version getConfStoreVersion() throws Exception {
  Version version = null;
  try {
    byte[] data = db.get(bytes(VERSION_KEY));
    if (data != null) {
      version = new VersionPBImpl(YarnServerCommonProtos.VersionProto
          .parseFrom(data));
    }
  } catch (DBException e) {
    throw new IOException(e);
  }
  return version;
}
